import {HeaderOnly} from "~/commonest/Layout";
import Home from "~/Pages/Home/home";
import Following from "~/Pages/Following/following";
import Upload from "~/Pages/upload/upload";
import Header from "~/Pages/";
// public router
const publicRouter = [
  {
    path: "/",
    component: Home,
  },
  {
    path: "/following",
    component: Following,
  },
  {
    path: "/upload",
    component: Upload,
  },
  {
    path: "/headerOnly",
    component: Header,
    layout: HeaderOnly,
  },
];
const privateRouter = [];
export {publicRouter, privateRouter};
